import React from 'react'
import { Container } from 'react-bootstrap'
import Footer from './Footer'
import Menu from './Menu'

const Home = () => {
  return (
    <Container fluid className='m-0 p-0 d-flex flex-column align-content-between justify-content-evenly'>
          <Menu /><Menu />
        <Footer />
    </Container>
  )
}

export default Home
